import '../components/About.css';
import PicMain4 from '../assets/PicMain4.png'
export const About = () => {
    return(
      <div className='contentAbout'>
        <div className='contentAboutLeft'><img src={PicMain4} className="imgAbout"/></div>
        <div className='contentAboutRight'></div>
      </div>
    )
}
